import collections

def count_divisors_of_factorial(N: int) -> int:
    mod = 10 ** 9 - 7
    factorial = 1
    for i in range(2, N + 1):
        factorial *= i
    prime_factors = []
    i = 2
    while i <= factorial:
        if factorial % i == 0:
            prime_factors.append(i)
            factorial //= i
        else:
            i += 1
    count = collections.Counter(prime_factors)
    ans = 1
    for v in count.values():
        ans *= v + 1
    return ans % mod

